Miley Stewart (Miley Cyrus) se las arregla como puede para compaginar el colegio, sus amigos y su vida secreta en el pop; pero su enorme popularidad amenaza con invadir toda su vida y ella parece aceptarlo gustosa. Asi que su padre decide llevarla a Crowley Corners, en Tennese, para darle una dosis de realidad. Alli comienza una aventura llena de diversion, risas y romance que ni la propia Hannah Montana podria imaginar.

